import React from 'react'; 
//import { Nav } from 'react-bootstrap';
import {Link} from 'react-router-dom';
import Home from './homepage.component';
import Features from '../../features.component/features.component';
import About from '../../about.component/about.component';
import RFID from '../../RFID.component/rfid.component';
import Customised from '../../customised.component/customised.component';
import MobileApp from '../../mobile.component/mobile.component';
import WeOffer from '../../weOffer.component/weOffer.component';
import { NavDropdown } from 'react-bootstrap';


function navbar() {
    return (
    <div className="container-fluid">
    
        <nav className ="navbar navbar-expand-md bg-dark navbar-dark">
        
                <a href="/" className="navbar-brand text-danger font-weight-bold" ><h6>RETAILCLICK</h6></a>

                <button className = "navbar-toggler" type="button" data-toggle="collapse" 
                    data-target="#collapsenavbar">
                            <span className="navbar-toggler-icon"> </span>
                </button>

                <div className= "collapse navbar-collapse " id ="collapsenavbar">
                    <ul className ="navbar-nav ml-auto">       
                        <li className="nav-item">
                            <a href ="/" className ="nav-link text-white"> HOME </a>
                        </li>
                        <li className="nav-item">
                            <a href ="/about" className ="nav-link text-white"> ABOUT </a>
                        </li>
                            
                        <div class="dropdown">
                            <button type="button" className="btn btn-dark dropdown-toggle" data-toggle="dropdown">
                                SERVICES
                            </button>
                            <div className="dropdown-menu bg-dark">
 
                                <a className="dropdown-item text-light" href="/rfid"><Link to="/RFID">RFID SOLUTIONS</Link></a>
                                <a className="dropdown-item text-light" href="/service">CUSTOMIZED DEVELOPMENT</a>
                                <a className="dropdown-item text-light" href="/service">MOBILE APP DEVELOPMENT</a>
                            </div>
                        </div>
                        
                        <li className="nav-item">
                            <a href ="/" className ="nav-link text-white"> CONTACT </a>
                        </li>
                        
                        <button className="btn btn-primary navbar-btn">Ask For Demo</button> 
                </ul>
            </div>
        </nav>
        
        
       <Features></Features>
       <About></About>
       <RFID></RFID>
       <Customised></Customised>
       <MobileApp></MobileApp>
       <WeOffer></WeOffer>

       <footer className="footer">
           <h9 className="text-center">Copyright © 2010, Design By Deven</h9>
       </footer>
       </div>
    );
}


export default navbar;
